import "./App.css"
import NavigationBar from "./component/NavigationBar"
import Intro from "./component/Intro";
import Trending from "./component/Trending"
import "./style/landingPage.css"
function App() {
  return (
    <div>
      {/* intro section */}
      <div className="myBG">
      <NavigationBar />
      <Intro />
      </div>
       {/* end of intro */}

       {/*trending section */}
       <div className="Trending">
        <Trending />

       </div>
        {/*end of trending section */}
    </div>
  );
}

export default App
